function initProCity(obj, def, val) {
    var oProvince = $('#' + obj[0]);
    var oCity = $('#' + obj[1]);
    var oDistrict = $('#' + obj[2]);
    var temp_html = '';
    //初始化省
    var province = function () {
        temp_html = "<option value=''>" + def[0] + "</option>";
        $.each(regionjson, function (i, province) {
            temp_html += "<option value='" + province.pid + "'>" + province.name + "</option>";
        });
        oProvince.html(temp_html);
        if (val != undefined && val.length > 0)
            oProvince.val(val[0]);
        city();
    };
    //赋值市
    var city = function () {
        temp_html = "<option value=''>" + def[1] + "</option>";
        var n = oProvince.find('option:selected').index() - 1;
        if (n > -1) {
            $.each(regionjson[n].city, function (i, city) {
                temp_html += "<option value='" + city.cid + "'>" + city.name + "</option>";
            });
        }
        oCity.html(temp_html);
        if (val != undefined && val.length > 1)
            oCity.val(val[1]);
        district();
    };
    //赋值县
    var district = function () {
        temp_html = "<option value=''>" + def[2] + "</option>";
        var m = oProvince.find('option:selected').index() - 1;
        var n = oCity.find('option:selected').index() - 1;
        if (oDistrict.parent().find('select').size() <= 1) {
            oDistrict.parent().css("display", "inline-block");
        } else {
            oDistrict.css("display", "inline-block");
        }
        if (m > -1 && n > -1) {
            if (typeof (regionjson[m].city[n].area) == "undefined") {
                oDistrict.css("display", "none");
            } else {
                if (n > -1) {
                    $.each(regionjson[m].city[n].area, function (i, district) {
                        temp_html += "<option value='" + district.aid + "'>" + district.name + "</option>";
                    });
                    if (regionjson[m].city[n].area.length < 1) {
                        if (oDistrict.parent().find('select').size() <= 1) {
                            oDistrict.parent().css("display", "none");
                        } else {
                            oDistrict.css("display", "none");
                        }
                    }
                }
                oDistrict.html(temp_html);
                if (val != undefined && val.length > 2)
                    oDistrict.val(val[2]);
            };
        } else {
            oDistrict.html(temp_html);
        }
    };
    //选择省改变市
    oProvince.change(function () {
        city();
    });
    //选择市改变县
    oCity.change(function () {
        district();
    });
    province();
}
